var script_f30_38_31341=[""].join("\n");
var outline_f30_38_31341=null;
var title_f30_38_31342="Infectious causes generalized lymphadenopathy children";
var content_f30_38_31342=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81033%7EPEDS%2F66847&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81033%7EPEDS%2F66847&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Infectious causes of generalized lymphadenopathy in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Infectious",
"       </td>",
"       <td class=\"subtitle1\">",
"        Selected clinical features that may be present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Viral",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Epstein-Barr virus",
"       </td>",
"       <td>",
"        Tonsillopharyngitis, splenomegaly (&gt;50 percent), fever, malaise, fatigue; periorbital edema",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cytomegalovirus",
"       </td>",
"       <td>",
"        Fever, malaise, fatigue, occasional hepatosplenomegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Herpes simplex virus",
"       </td>",
"       <td>",
"        Grouped vesicles; gingivostomatitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Varicella zoster virus",
"       </td>",
"       <td>",
"        Generalized vesicular rash appearing in crops",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Adenovirus",
"       </td>",
"       <td>",
"        Respiratory tract symptoms, pharyngitis, conjunctivitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rubella",
"       </td>",
"       <td>",
"        Fever and rash; may be asymptomatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatitis B virus",
"       </td>",
"       <td>",
"        High-risk sexual behavior, exposure to blood products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rubeola (measles)",
"       </td>",
"       <td>",
"        Maculopapular rash with cranial to caudal progression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Human immunodeficiency virus",
"       </td>",
"       <td>",
"        Recurrent bacterial infection, opportunistic infection, fever, diarrhea, encephalopathy, failure to thrive, hepatosplenomegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Fungal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Coccidioidomycosis (valley fever)",
"       </td>",
"       <td>",
"        Pneumonia; travel to or residence in endemic area (eg, southwestern United States)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Blastomycosis",
"       </td>",
"       <td>",
"        Pneumonia; travel to or residence in an endemic area (eg, southeastern and south central United States, Africa)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Bacterial",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Group A streptococcal disease",
"       </td>",
"       <td>",
"        Rash followed by desquamation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Brucellosis",
"       </td>",
"       <td>",
"        Fever, sweats, malaise, fatigue, weight loss, ingestion of unpasteurized milk; exposure to cattle, sheep, or goats",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tularemia",
"       </td>",
"       <td>",
"        Fever, chills, headache; ingestion of undercooked meats, exposure to rabbits, rodents, biting flies, or mosquitoes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Leptospirosis",
"       </td>",
"       <td>",
"        Fever, rigors, myalgia, headache, conjunctival injection, rash, hepatosplenomegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Spirochetal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Syphilis",
"       </td>",
"       <td>",
"        Rash, fever, malaise, anorexia, and weight loss, hepatomegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lyme disease",
"       </td>",
"       <td>",
"        Erythema migrans, fever, headache, myalgia, malaise, arthralgia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Parasitic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Toxoplasmosis",
"       </td>",
"       <td>",
"        Most infections in immunocompetent hosts are asymptomatic; myalgia, fatigue, fever, splenomegaly, and maculopapular rash may be present; exposure to cats",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Leishmaniasis",
"       </td>",
"       <td>",
"        Cutaneous lesions, organomegaly, fever, cachexia; exposure to sandflies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Malaria",
"       </td>",
"       <td>",
"        Fever, travel to or residence in an endemic area",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Malley R. Lymphadenopathy. In: Textbook of Pediatric Emergency Medicine, 5th ed, Fleisher GR, Ludwig S, Henretig FM (Eds), Lippincott Williams and Wilkins, Philadelphia 2006. p.421.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Noninfectious causes of generalized lymphadenopathy in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Neoplastic",
"       </td>",
"       <td class=\"subtitle1\">",
"        Selected clinical features that may be present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Primary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hodgkin lymphoma",
"       </td>",
"       <td>",
"        Usually manifests as cervical lymphadenopathy; adenopathy may be unilateral; respiratory distress can occur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Non-Hodgkin lymphoma",
"       </td>",
"       <td>",
"        Rapidly enlarging diffuse adenopathy, abdominal pain, vomiting; adenopathy is usually bilateral; respiratory distress can occur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Metastatic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Acute lymphocytic or myelogenous leukemia",
"       </td>",
"       <td>",
"        Ill appearance, bleeding, hepatosplenomegaly, anemia, thrombocytopenia; occipital nodes often prominent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Neuroblastoma",
"       </td>",
"       <td>",
"        Abdominal mass; opsoclonus-myoclonus, proptosis, periorbital echymoses, nasal obstruction, Horner syndrome, subcutaneous nodules, secretory diarrhea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rhabdomyosarcoma",
"       </td>",
"       <td>",
"        Proptosis; nasal, aural, or sinus obstruction; hematuria; urinary obstruction; constipation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Immunologic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Kawasaki disease",
"       </td>",
"       <td>",
"        Conjunctivitis, peeling skin on hands, diffuse rash, coronary artery dilation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Vasculitis syndromes (systemic lupus erythematosus, rheumatoid arthritis)",
"       </td>",
"       <td>",
"        Patients may have generalized adenopathy during the acute phase of illness",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum sickness",
"       </td>",
"       <td>",
"        Rash, splenomegaly, myalgia, arthritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Autoimmune hemolytic anemia",
"       </td>",
"       <td>",
"        Lymphadenopathy coincides with hemolysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Chronic granulomatous disease",
"       </td>",
"       <td>",
"        Recurrent infection, skin abscesses, suppurative adenitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Metabolic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Gaucher disease",
"       </td>",
"       <td>",
"        Hepatosplenomegaly, anemia, thrombocytopenia, osteopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Niemann-Pick disease",
"       </td>",
"       <td>",
"        Hepatosplenomegaly, loss of neurologic function",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Drugs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Phenytoin, phenobarbitol, carbamazepinem, isoniazid, aspirin, barbiturates, penicillin, tetracycline, iodides, sulfonamides, allopurinol, and phenylbutazone",
"       </td>",
"       <td>",
"        Severe maculopapular rash, fever, hepatosplenomegaly, jaundice, anemia, leukopenia, and plasmacytosis occurring during or after the lymphadenopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sarcoidosis",
"       </td>",
"       <td>",
"        Multisystem granulomatous disease; generalized adenopathy with prominent cervical involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hemophagocytic lymphohistiocytosis",
"       </td>",
"       <td>",
"        Fever, hepatosplenomegaly, neurologic symptoms, rash",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Castleman disease",
"       </td>",
"       <td>",
"        Fever, hepatosplenomegaly, polyclonal hypergammaglobulinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Langerhans cell histiocytosis",
"       </td>",
"       <td>",
"        Rash (brown to purplish papules), mucosal lesions, lytic bone lesions, proptosis, diabetes insipidus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Kikuchi-Fujimoto disease",
"       </td>",
"       <td>",
"        Cervical and supraclavicular adenopathy, fever, fatigue, weight loss, anemia, and leukopenia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rosai-Dorfman disease (sinus histiocytosis with massive lymphadenopathy)",
"       </td>",
"       <td>",
"        Chronic bilateral cervical adenopathy is characteristic; other nodal groups are involved in most cases; fever, anemia, leukocytosis, elevated ESR, and hypergammaglobulinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hyperthyroidism",
"       </td>",
"       <td>",
"        Tachycardia, hypertension, diaphoresis, weight loss, goiter, hyperreflexia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Papular acrodermatitis (Gianotti-Crosti syndrome)",
"       </td>",
"       <td>",
"        Rash on face, buttocks, limbs, palms, and soles; hepatomegaly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Progressive transformation of germinal centers",
"       </td>",
"       <td>",
"        Found in 10 percent of nodes with reactive hyperplasia; sometimes associated with prior diagnosis of Hodgkin lymphoma and rarely before the diagnosis of Hodgkin lymphoma",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from:",
"     <br>",
"      <ol>",
"       <li>",
"        Malley R. Lymphadenopathy. In: Textbook of Pediatric Emergency Medicine, 5th ed, Fleisher GR, Ludwig S, Henretig FM (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2006. p.421.",
"       </li>",
"       <li>",
"        Scagni P, Peisino MG, Bianchi M, et al. Kikuchi-Fujimoto disease is a rare cause of lymphadenopathy and fever of unknown origin in children. J Pediatr Hematol Oncol 2005; 27:337.",
"       </li>",
"       <li>",
"        Osborne BM, Butler JJ, Gresik MV. Progressive transformation of germainal centers: Comparison of 23 pediatric patients to the adult population. Modern Pathology 1992; 5:135.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
